import React from 'react';

function PricingComp(props) {
    return (
        <div className = 'card'>
            <div className = 'card-body'>
                <h3 className = 'card-title'>{ props.pricingName }</h3>
                <h6 className = "card-subtitle text-muted">{ props.pricingExplain["explain1"] }</h6>
                <h6 className = "card-subtitle text-muted">{ props.pricingExplain["explain2"] }</h6>
                <h6 className = "card-subtitle text-muted">{ props.pricingExplain["explain3"] }</h6>

                <ul className = "list-group list-group-flush">
                    <li className = "list-group-item">{ props.pricingExplain["explain4"] }{ props.lowPrice }</li>
                    <li className = "list-group-item">{ props.pricingExplain["explain5"] }{ props.resonablePrice }</li>
                    <li className = "list-group-item">{ props.pricingExplain["explain6"] }{ props.highPrice }</li>
                </ul>
            </div>
        </div>
    );
}

export default PricingComp;
